import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { PieChart, Pie, Tooltip } from "recharts";

import "./superHome.css";

export default function SuperUserData() {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState({
    users: [],
    companies: [],
    superUser: null,
  });
  const [data01, setData01] = useState([]);

  const navigate = useNavigate();

  const fetchData = () => {
    const superUserAuthenticated = localStorage.getItem("superUserAuthenticated");

    if (!superUserAuthenticated) {
      navigate("/superUser/login");
      return;
    }

    fetch("http://localhost:5000/getAllData")
      .then((response) => response.json())
      .then((fetchedData) => {
        // Filter out Super User data
        const superUserData = fetchedData.data.users.find(
          (user) => user.userType === "superuser"
        );

        const filteredData = {
          users: fetchedData.data.users.filter(
            (user) => user.userType !== "superuser"
          ),
          companies: fetchedData.data.companies,
          superUser: superUserData,
        };

        setData(filteredData);

        setLoading(false);

        // Set the chart data without Super User
        setData01([
          { name: "Users", value: filteredData.users.length },
          { name: "Companies", value: filteredData.companies.length },
        ]);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  const deleteUser = (id, name) => {
    // Implement the delete logic for users
  };

  const deleteCompany = (id, name) => {
    // Implement the delete logic for companies
  };

  const logout = () => {
    window.localStorage.clear();
    navigate("/superUser/login");
  };

  return (
    <div>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          <h4>{console.log(data)}
            Hello {data.superUser.fname} {data.superUser.lname}
          </h4>
          {/* Display Super User details here */}

          <table className="table table-striped table-bordered">
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Email</th>
                <th>User Type</th>
                <th>Delete</th>
              </tr>
            </thead>
            <tbody>
              {data.users.map((user) => (
                <tr key={user._id}>
                  <td>{user._id}</td>
                  <td>
                    {user.fname} {user.lname}
                  </td>
                  <td>{user.email}</td>
                  <td>{user.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteUser(user._id, `${user.fname} ${user.lname}`)
                    }
                  >
                    Delete
                  </td>
                </tr>
              ))}
              {data.companies.map((company) => (
                <tr key={company._id}>
                  <td>{company._id}</td>
                  <td>
                    {company.fname} {company.lname}
                  </td>
                  <td>{company.email}</td>
                  <td>{company.userType}</td>
                  <td
                    className="btn btn-danger"
                    onClick={() =>
                      deleteCompany(company._id, `${company.email}`)
                    }
                  >
                    Delete
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          <p>TOTAL COMPANIES: {data.companies.length}</p>
          <p>TOTAL USERS: {data.users.length}</p>
          <p>
            TOTAL ACCOUNTS: {data.users.length + data.companies.length}
          </p>
          <button className="btn btn-primary" onClick={logout}>
            Logout
          </button>

          <PieChart width={1000} height={400}>
            <Pie
              data={data01}
              dataKey="value"
              nameKey="name"
              cx="50%"
              cy="50%"
              outerRadius={130}
              fill="#8884d8"
            ></Pie>
            <Tooltip />
          </PieChart>
        </div>
      )}
    </div>
  );
}
